    <>
      <h1 className="test"> Test component!</h1>
      <p>버튼을 눌러봐</p>
      {Temp}
      <button
        onClick={() => {
          let arr = [];
          arr = [...Temp];
          arr.push(Number);
          setNumber(Number + 1);
          setTemp(...arr);
        }}
      >
        증가
      </button>
    </>
  );
}

export default Test;

